// A variável imgBase64 já contém o código da imagem em base64

function calcularTotal() {
  const linhas = document.querySelectorAll("#tabela tbody tr");
  let totalGeral = 0;

  linhas.forEach((linha) => {
    const quantidade = parseFloat(linha.querySelector(".quantidade").value);
    const valorUnitario = parseFloat(
      linha.querySelector(".valor-unitario").value
    ).toFixed(2); // Garantir 2 casas decimais
    const valorTotal = quantidade * valorUnitario;

    linha.querySelector(".valor-unitario").value = valorUnitario; // Atualizar o valor unitário com 2 casas decimais
    linha.querySelector(".valor-total").value = valorTotal.toFixed(2); // Garantir 2 casas decimais no valor total
    totalGeral += valorTotal;
  });

  document.getElementById("total-geral").textContent = totalGeral.toFixed(2); // Garantir 2 casas decimais no total geral
}

function adicionarLinha() {
  const tabela = document.getElementById("tabela").querySelector("tbody");
  const novaLinha = document.createElement("tr");

  novaLinha.innerHTML = `
    <td><input type="number" class="quantidade" value="1" min="1" onchange="calcularTotal()"></td>
    <td><input type="text" class="discriminacao"></td>
    <td><input type="number" class="valor-unitario" value="0" min="0" step="0.01" onchange="calcularTotal()"></td>
    <td><input type="number" class="valor-total" value="0" readonly></td>
    <td><button class="btn-excluir" onclick="excluirLinha(this)">X</button></td>
  `;

  tabela.appendChild(novaLinha);
}

function excluirLinha(button) {
  const linha = button.closest("tr");
  linha.remove();
  calcularTotal(); // Recalcular o total após a exclusão
}

const imgBase64 =
  "data:image/jpeg;base64,";

function gerarPDF() {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();

  const larguraPagina = 210; // em mm (A4)
  const alturaPagina = 297; // em mm
  const margemSuperior = 10;
  const margemInferior = 10;
  const alturaDisponivel = alturaPagina - margemSuperior - margemInferior;

  // Carregar a imagem base64
  const img = new Image();
  img.src = imgBase64;

  img.onload = function () {
    // Calcular a altura da imagem com base na largura da página (mantendo a proporção)
    const proporcao = img.width / img.height;
    let alturaImagem = larguraPagina / proporcao; // Calculando a altura

    // Verificar se a altura da imagem excede a altura da página (A4)
    if (alturaImagem > alturaPagina) {
      // Ajustar a altura para caber na página, mantendo a proporção
      alturaImagem = alturaPagina;
    }

    // Adicionar a imagem ao PDF
    doc.addImage(imgBase64, "PNG", 0, 0, larguraPagina, alturaImagem);

    // Pegar o Nome e Endereço do Cliente
    const nomeCliente = document.getElementById("nome-cliente").value;
    const enderecoCliente = document.getElementById("endereco-cliente").value;

    // Data do preenchimento
    const dataHoje = new Date();
    const dataFormatada = `${dataHoje.getDate()}/${
      dataHoje.getMonth() + 1
    }/${dataHoje.getFullYear()}`;

    // Adicionar informações do cliente e a data
    doc.setFontSize(12);
    doc.setTextColor(0, 0, 0); // Cor preta
    doc.text(`Nome do Cliente: ${nomeCliente}`, 10, alturaImagem + 10);
    doc.text(`Endereço: ${enderecoCliente}`, 10, alturaImagem + 20);
    doc.text(`Data: ${dataFormatada}`, 10, alturaImagem + 30);

    // Subtítulo (informações)
    doc.setFontSize(12);
    doc.text("Tabela de Serviços", 10, alturaImagem + 50);

    // Tabela no PDF (com cabeçalho e linhas)
    let y = alturaImagem + 60; // Começa após a imagem e informações
    const linhaHeight = 12; // Ajuste a altura da linha

    // Cabeçalho da tabela
    function desenharCabecalho(yPos) {
      doc.setFont("helvetica", "bold");
      doc.setFontSize(15);
      doc.setTextColor(0, 0, 0); // Texto preto

      // Retângulos do cabeçalho (linhas pretas)
      doc.rect(10, yPos, 40, linhaHeight); // Quantidade
      doc.rect(50, yPos, 60, linhaHeight); // Descrição
      doc.rect(110, yPos, 50, linhaHeight); // Valor Unitário
      doc.rect(160, yPos, 40, linhaHeight); // Valor Total

      // Texto do cabeçalho
      doc.text("Quantidade", 15, yPos + linhaHeight / 2 + 3); // Centraliza verticalmente
      doc.text("Descrição", 55, yPos + linhaHeight / 2 + 3);
      doc.text("Valor Unitário", 115, yPos + linhaHeight / 2 + 3);
      doc.text("Valor Total", 165, yPos + linhaHeight / 2 + 3);

      return yPos + linhaHeight; // Retorna a posição vertical após o cabeçalho
    }

    y = desenharCabecalho(y); // Adicionar o cabeçalho inicial

    doc.setFont("helvetica", "normal");
    doc.setFontSize(10);

    // Linhas da tabela
    const linhas = document.querySelectorAll("#tabela tbody tr");
    linhas.forEach((linha) => {
      const quantidade = linha.querySelector(".quantidade").value;
      const discriminacao = linha.querySelector(".discriminacao").value;
      const valorUnitario = parseFloat(
        linha.querySelector(".valor-unitario").value
      ).toFixed(2);
      const valorTotal = parseFloat(
        linha.querySelector(".valor-total").value
      ).toFixed(2);

      const descricaoMaxWidth = 50; // Largura máxima para a descrição

      // Dividir o texto da descrição para caber na largura máxima
      const descricoesQuebradas = doc.splitTextToSize(
        discriminacao,
        descricaoMaxWidth
      );
      const unidadeQuebrada = `R$ ${valorUnitario}`;
      const totalQuebrado = `R$ ${valorTotal}`;

      // Ajuste da altura da célula para a descrição (em função do número de linhas da descrição)
      const alturaNovaLinha =
        Math.max(descricoesQuebradas.length, 1) * linhaHeight;

      // Verificar se há espaço suficiente na página
      if (y + alturaNovaLinha > alturaDisponivel) {
        doc.addPage(); // Adicionar nova página
        y = margemSuperior; // Reiniciar a posição vertical
        y = desenharCabecalho(y); // Redesenhar o cabeçalho
        doc.setFont("helvetica", "normal");
        doc.setFontSize(10);
      }

      // Célula Quantidade
      doc.rect(10, y, 40, alturaNovaLinha); // Quantidade
      doc.setTextColor(0, 0, 0); // Cor preta para o texto
      doc.text(quantidade, 15, y + linhaHeight / 2); // Centralizado na célula

      // Célula Descrição
      doc.rect(50, y, 60, alturaNovaLinha); // Descrição
      doc.text(descricoesQuebradas, 55, y + linhaHeight / 2); // Centralizado na célula

      // Célula Valor Unitário
      doc.rect(110, y, 50, alturaNovaLinha); // Valor Unitário
      doc.text(unidadeQuebrada, 115, y + linhaHeight / 2); // Centralizado na célula

      // Célula Valor Total
      doc.rect(160, y, 40, alturaNovaLinha); // Valor Total
      doc.text(totalQuebrado, 165, y + linhaHeight / 2); // Centralizado na célula

      // Atualizar a posição para a próxima linha
      y += alturaNovaLinha; // Avançar para a próxima linha
    });

    // Linha para o Total Geral
    doc.setFont("helvetica", "bold");
    doc.setFontSize(12);
    doc.setTextColor(0, 0, 0);
    doc.text("Total Geral:", 110, y + 7);
    doc.text(
      "R$ " + document.getElementById("total-geral").textContent,
      165,
      y + 7
    );

    // Salvar o PDF
    const nomeArquivo = nomeCliente.trim() ? `${nomeCliente.trim()}.pdf` : "tabela_servicos.pdf";
doc.save(nomeArquivo);    

  img.onerror = function () {
    alert("Erro ao carregar a imagem");
  };
}}
